vector <int> taxi_con, train_con, bus_con;
int parent_array[199];			int not_found[199];
set <int> neighbours;
void find_connected_nodes(int current_pos)
{
	int i;
	neighbours.clear();
	taxi_con.clear();
	train_con.clear();
	bus_con.clear();
	for(i=0;i<199;i++)
	{
		if(london[current_pos][i] != 0)
			neighbours.insert(i);
		if(train[i][current_pos] == 1)
		{
			train_con.push_back(i);
		}
		if(taxi[i][current_pos] == 1)
		{
			taxi_con.push_back(i);
		}
		if(bus[i][current_pos] == 1)
		{
			bus_con.push_back(i);
		}
	}
}



int dist_val[199]; int node_tic_less[3][199];
void find_distances(int start)//, int tic_t, int tic_b, int tic_u)
{
	/*
		int aukaat[3][199]; int i, j;
		for(i=0; i<3; i++)
			for(j=0; j<199; j++)
				aukaat[i][j] = 0;
		aukaat[0][start] = t; aukaat[1][start] = b; aukaat[2][start] = u;
	*/
	int i, parent, val;
	//int not_found[199];
	for(i=0;i<199;i++)
	{
		parent_array[i] = -1;
		not_found[i] = 1;
	}
	queue<int> myqueue;
	myqueue.push(start);
	parent_array[start] = -1; dist_val[start] = 0; not_found[start] = 0;
	for(i=0; i<3; i++)
		node_tic_less[i][start] = 0;
	while (!myqueue.empty() )
	{
		parent = myqueue.front();
		find_connected_nodes(parent);
		for (set<int>::iterator it = neighbours.begin() ; it != neighbours.end(); ++it)
		{
			val = *it;
			if(not_found[val] == 1)
			{
				parent_array[val] = parent; dist_val[val] = dist_val[parent] + 1;
				
				for(i=0; i<3; i++)
					{ node_tic_less[i][val] = node_tic_less[i][parent]; }
				if(train[val][parent])
					node_tic_less[2][val]--;
				else if(bus[val][parent])
					node_tic_less[1][val]--;
				else if(taxi[val][parent])
					node_tic_less[0][val]--;
				
				myqueue.push(val);
				not_found[val] = 0;
			}
		}
		myqueue.pop();
	}

}



int find_taxi_distance(int start , int end )
{		
		int parent, val,found = 0,i;
		for(i=0;i<199;i++)
		{
			parent_array[i] = -1;
			not_found[i] = 1;
		}
		queue<int> myqueue;
		myqueue.push(start);
		parent_array[start] = start;
		while (!myqueue.empty() && found == 0)
		{
			parent = myqueue.front();
			find_connected_nodes(parent);
			for (vector<int>::iterator it = taxi_con.begin() ; it != taxi_con.end(); ++it)
			{
				val = *it;
				if(not_found[val] == 1)
				{
					parent_array[val] = parent;
					myqueue.push(val);
					not_found[val] = 0;
					if(val == end)
					{
						found = 1;
					}
				}
			}
			myqueue.pop();
		}
	int distance = 1;
	int curr_node = end;
	while(parent_array[curr_node] != start)
	{
		distance = distance  + 1; 
		curr_node = parent_array[curr_node];
	}

	return distance;
}

